import { Route, BrowserRouter } from 'react-router-dom';

import Home from './pages/Home';
import CreatePoint from './pages/CreatePoint';

const Routes = () => {
    return (
        <BrowserRouter>
            <Route>
                <Route element={<Home />} path="/" />
            </Route>
        </BrowserRouter>
    )
}

export default Route;
